import React from 'react';
import './home.css' ;
// Hussain idhar home page bana thike me sone jara 30 mins me aata hu {13:16}
function Home(){
    return(
        <div id="homePage-wrapper" style={{backgroundImage : 'url("assets/hpbg.png")',backgroundRepeat:'no-repeat',backgroundSize:'fill',width:'100%'}}>
            <div id="NavBar">
                <div id="nav-right">
                    <img src="assets/pixil-frame-0.png" id="logo" alt="logo"/>
                </div> 
                <div id="nav-left">
                    <a>Discover</a>
                    <a>Help</a>
                    <button>Sign In</button>
                </div>
            </div>
            <div id="line"><h1>Get Rewarded to SAVE!</h1>
                        <button>Join Us</button>            
            </div>
        </div>
    )
}

export default Home;
